import { Link } from "react-router-dom";

const EVENTS = [
{id:"e1", title:"Event 1"},
{id:"e2", title:"Event 2"},
{id:"e3", title:"Event 3"},
{id:"e4", title:"Event 4"},
{id:"e5", title:"Event 5"},
]

function EventsPage() {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {EVENTS.map((event) => <li></li>)}
      </ul>
    </>
  );
}

export default EventsPage;
